// SPDX-License-Identifier: MIT

pragma solidity ^0.8.15;

import "./MintMusicToken.sol";


contract Auction{
    //
    address public TokenOwner;
    //
    uint public auctionStart;
    //
    uint public auctionEnd;
    //id
    uint public tokenId;
    //
    uint public minimumBid;

    //
    address public highestBidder;
    //
    uint public highestBid;

    uint public date;

    MintMusicToken public mintMusicTokenAddress;// 

    //
    //(  )
    //  => 
    mapping(address => uint) refundOfBid;


    //
    uint[] public AuctionList;

    //event
    event AuctionInfo (address indexed owner, uint256 indexed tokenId, uint256 auctionStart, uint256 minimumBid);//
    event AuctionCancle (address indexed owner, uint256 indexed tokenid);// 
    event AuctionEnded (address indexed winner, uint256 winningBid, uint256 auctionEnd, uint256 indexed tokenId);//

    //
    //, tokenId, , , 
    constructor(address _mintMusicTokenAddress){
       mintMusicTokenAddress = MintMusicToken(_mintMusicTokenAddress);

    }

    //Auction

    //**      */
    function SimpleAuction(uint256 _tokenId, uint256 _auctionStart, uint256 _auctionEnd, uint256 _minimumBid) public {
        TokenOwner = mintMusicTokenAddress.ownerOf(_tokenId);//tokenId   TokenOwner 
        // date = getData(uint block.timestamp)+getMonth(uint block.timestamp)+getFullYear(uint block.timestamp)+getHours(uint block.timestamp)+getMinutes(uint block.timestamp)+getseconds(uint block.timestamp)); 

        require(_minimumBid > 0 , "Minimum bid must be at least 0");//  0
        require(_auctionStart > block.timestamp , "Please set the auction start time after the current time");// 
        require(_auctionEnd > _auctionStart , "The auction closing time must be after the start time");// 
        require(TokenOwner == msg.sender ,"Register your own token");// 

        tokenId = _tokenId;
        auctionStart = _auctionStart;
        auctionEnd = _auctionEnd;
        minimumBid = _minimumBid;

        AuctionList.push(_tokenId);//  

        emit AuctionInfo (TokenOwner, tokenId, auctionStart, minimumBid);

    }


    //  + 
    function BidOffer(uint _tokenId ) public payable {
        TokenOwner = mintMusicTokenAddress.ownerOf(_tokenId);

        require(TokenOwner != msg.sender ,"Token owner cannot be a bidder");//   
        require(block.timestamp <= auctionEnd ,"auction is over");//  
        require(msg.value > minimumBid , "The price I offer must be higher than the lowest bid");//  
        require(msg.value > highestBid , "Please provide the highest bid");//   
        require(msg.sender.balance > msg.value , "Token balance is less than the amount presented");//          


        if (highestBid != 0) {
            refundOfBid[highestBidder] += highestBid; 
        }// 0      ,       

        highestBidder = msg.sender;
        highestBid = msg.value;

        payable(TokenOwner).transfer(highestBid);


        //
        if(auctionEnd -1 minutes >= block.timestamp){//1      1   ( 59 )
            if(block.timestamp >= auctionEnd -5 minutes){//   5 
                TimeExtension(_tokenId);
            }
        }

        //
        require(auctionEnd == block.timestamp);
        AuctionEnd(_tokenId);

    }

    // (   ,  ,    )
    function AuctionCancel(uint _tokenId) public {
        TokenOwner = mintMusicTokenAddress.ownerOf(_tokenId);

        require(block.timestamp < auctionEnd ,"auction is over");//  
        require(msg.sender == TokenOwner, "Only the token owner can cancel");//   
        require(highestBid > 0, "there is a bidder");//  

        //    
        //   
        for(uint256 i = 0; i < AuctionList.length; i++) {
            if(AuctionList[i] == _tokenId ) {
                AuctionList[i] = AuctionList[AuctionList.length - 1];
                AuctionList.pop();//  

            }
        } 
    }


    //     
    function TimeExtension(uint _tokenId) public{
        TokenOwner = mintMusicTokenAddress.ownerOf(_tokenId);

        require(block.timestamp < auctionEnd, "auction is over");//  
        require(msg.sender == TokenOwner, "Only the token owner can cancel");//   

        if(auctionEnd -1 minutes >= block.timestamp){//1      1   ( 59 )
            if(block.timestamp >= auctionEnd -5 minutes){//   5 
                auctionEnd += 10 minutes;
            }//  5 1     10
        }
    }

    //   
    // 
    function BidReturn() public payable returns (bool){
        uint amount = refundOfBid[msg.sender];

        if(amount > 0){// 0()
            payable(msg.sender).transfer(amount);//
            refundOfBid[msg.sender] = 0;//amount 0 
        }
        return true;
    }


    //  +     
    // (payable(tokenOnwer).transfer(msg.value);
    function AuctionEnd(uint _tokenId) public {
        TokenOwner = mintMusicTokenAddress.ownerOf(_tokenId);

        require(auctionEnd < block.timestamp , "Auction isn't over yet");// 

        // //   
        // payable(TokenOwner).transfer(highestBid);

        mintMusicTokenAddress.transferFrom(TokenOwner, highestBidder, _tokenId);//

        //   
        for(uint256 i = 0; i < AuctionList.length; i++) {
            if(AuctionList[i] == _tokenId ) {
                AuctionList[i] = AuctionList[AuctionList.length - 1];
                AuctionList.pop();//  
            }
        } 

        BidReturn();
        emit AuctionEnded (highestBidder, highestBid, auctionEnd, _tokenId);
    }    
}
